import React from 'react';
import Faker from 'faker';

const ProfileView = () => {
   return (
      <div>
         <h1>My Profile</h1>
         <div>
            <img src={Faker.internet.avatar} />
            <div></div>
         </div>
      </div>
   );
};

export default ProfileView;
